Número de casos não é parâmetro. Porcentagem que deveria ser.

3 principais triggers para a virada do mercado:

- Estímulos públicos: medidas fiscais e monetárias dos BCs;
- Eficácia dos testes clínicos p/ tratamento e produção da vacina;
- Diminuição de casos na Europa, juntamente com a comprovação da baixíssima taxa de mortalidade do vírus
